import React, { useState } from "react";

import { TeamStyle } from "./TeamStyle";
import FontP from "../../styles/fontsStyles/fontP";
import FontA from "../../styles/fontsStyles/FontA"
import Fonth1 from "../../styles/fontsStyles/Fonth2"
import Fonth2 from "../../styles/fontsStyles/Fonth2"

import Team from "./Team"

import home from "../../content/home.json"


const displayTeam = () => {
    return (
        home.map((member, i) => {
            const { img, title, text1, text2 } = member;
            return (
                <div className="global" key={i} >
                    <div className="colum1" >
                        <img src={img} />
                    </div>
                    <div className="title">
                        <Fonth2> {title}</Fonth2>
                    </div>
                    <div className="colum1">
                        <div className="text">
                            <Team />
                            <Fonth2> {text1}</Fonth2>
                        </div>
                    </div>
                </div>
            )
        })
    )
}


const PhotoTeam = props => {
        return (
            <TeamStyle >
                {displayTeam()}
            </TeamStyle>
        );
    };

    export default PhotoTeam;
